#   https://leetcode.com/problems/brick-wall


from collections import defaultdict
from typing import List


class Solution:
    #   https://leetcode.com/explore/challenge/card/april-leetcoding-challenge-2021/596/week-4-april-22nd-april-28th/3717
    #   runtime; 176ms, 84.56%
    #   memory; 19.1MB, 86.13%
    def leastBricks(self, wall: List[List[int]]) -> int:
        if wall is None or 0 == len(wall) or 0 == len(wall[0]):
            return 0
        floors = len(wall)
        if all(len(w) == 1 for w in wall):
            return floors
        if 1 == floors:
            if 1 == len(wall[0]):
                return 1
            return 0
        d = defaultdict(int)
        for w in wall:
            prev = 0
            for n in w:
                prev += n
                d[prev] += 1
        maxWidth = max(d.keys())
        del d[maxWidth] #   brick wall의 가장 오른쪽은 cross check에 필요없으므로 제거

         # 가장 큰 값이 양쪽 block이 나뉜 경계이므로 cross가 가능한 곳이므로 floors에서 이 값을 빼면 cross 횟수
        return floors - max(d.values())


